(15071, '180', '2016-01-05', '08:48:47', '231', '2016-01-05', '205       ', '2016-01-13', 3, 2, 216, 3511, 'TIDAK BOLEH AKSES MAYBANK - ERROR MESSAGE "YOUR BROWSER DOES NOT SUPPORT AJAX"', '5/1/2016 ZAMRI - \r\n1) TEST AKSES KE LAMAN WEB MAYBANK2E.NET\r\n2) USER TEST LOGIN\r\n3) USER DAPAT LOGIN\r\n4) USER KLIK YES UTK TERIMA INSTALL ACTIVEX PLUGIN\r\n5) USER LOGOUT\r\n6) USER LOGIN SEMULA\r\n7) USER DAPAT PRINT DARI SISTEM TERSEBUT\r\n8) FEEDBACK USER SETAKAT INI - OK', 106, '09:10:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15072, '208', '2016-01-05', '08:57:30', '096', '2016-01-28', '205       ', '2016-02-15', 3, 10, 219, 2151, 'AKAUN PENERIMA', '28/1/2016 NARGIS - 1) PERMOHONAN TELAH DISELESAIKAN\r\n2) USER MENERIMA & MENGESAHKAN PERMOHONAN\r\n==============\r\n5/1/2016 NARGIS - 1) MELENGKAPKAN BORANG PERMOHONAN\r\n2) MENGAJUKAN KEPADA EN.SUHAIMI UNTUK TINDAKAN LANJUT', 106, '09:00:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15074, '139', '2016-01-05', '09:36:13', '096', '2016-01-05', '205       ', '2016-01-05', 3, 10, 233, 3397, 'LAPORAN MAJIKAN TAHUN LEPAS YANG TAK ULANG BAYAR TAHUN INI', '5/1/2016 NARGIS - 1) MELENGKAPKAN BORANG PERMOHONAN\r\n2) MENGAJUKAN KEPADA EN.SUHAIMI UNTUK TINDAKAN LANJUT\r\n3) LAPORAN INI SUDAH WUJUD\r\n4) PERMOHONAN TIDAK PERLU DIBUAT', 106, '09:44:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15075, '086', '2016-01-05', '09:40:02', '205', '2016-01-05', '205       ', '2016-01-05', 3, 10, 212, 3879, 'PERMOHONAN PENAMATAN USER ID UNTUK SIZA - NUGRAHA KARNEN BIN DZULKARNAIN', '5/1/2106 NARGIS - 1) MELENGKAPKAN BORANG PERMOHONAN\r\n2 ) KEMASKINI STATUS ID SIZA DARI AKTIF KE TAMAT - ID =  KS019\r\n3) PERMOHONAN TELAH DISELESAIKAN\r\n4) MEMAKLUMKAN KEPADA USER TENTANG STATUS PERMOHONAN\r\n----------------------\r\nFROM: "ICT HELPDESK" <ICTHELPDESK@ZAKAT.COM.MY>\r\nTO: "AFFRINI" <AFFRINI@ZAKAT.COM.MY>\r\nCC: "AMRAN HAZALI" <AMRANHAZALI@ZAKAT.COM.MY>, "NOORUL" <NOORUL@ZAKAT.COM.MY>\r\nSENT: TUESDAY, JANUARY 5, 2016 9:46:38 AM\r\nSUBJECT: PENAMATAN ID PRAKTIKAL - NUGRAHA (KS019)\r\n\r\nIMEJ DI BAWAH ADALAH STATUS BAGI SIZA ID YANG TELAH DITAMATKAN SEPERTI YANG DIMOHON. \r\n\r\nEXECUTIVE IT HELPDESK', 106, '09:42:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
