(15583, '203', '2016-03-22', '14:52:12', '205', '2016-03-22', '205       ', '2016-03-22', 3, 10, 236, 1827, 'UPDATE KP PEMBAYAR DARI 62010106538  KE 620101065338 (ROHAMA BINTI KANIN)', '22/3/2016 NARGIS - 1) MERGE KP DI SPZV3.0 - PENERIMAAN BAYARAN - PENYATA BAYARAN - GABUNG REKOD - UPDATE KP LAMA\r\n2) UPDATE KP YANG SALAH KE KP YANG BETUL\r\n3) MEMBERITAHU USER TENTANG PENUKARAN', 106, '15:00:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15584, '204', '2016-03-22', '15:58:14', '083', '2016-03-22', '205       ', '2016-03-23', 3, 3, 237, 2938, 'FROM: "NIK ARMIZA EZRA" <ARMIZA@ZAKAT.COM.MY>\r\nTO: "ZULKIFLI CHE DERAMAN" <ZULKIFLI@ZAKAT.COM.MY>, "ICT HELPDESK" <ICTHELPDESK@ZAKAT.COM.MY>\r\nCC: "FAUZI" <FAUZI@ZAKAT.COM.MY>, "MUHAMMAD KHAIRI ISAHAK" <KHAIRI@ZAKAT.COM.MY>, "AHMAD RUZAINI ROHIDAN" <AHMADRUZAINI@ZAKAT.COM.MY>\r\nSENT: MONDAY, MARCH 21, 2016 11:34:44 AM\r\nSUBJECT: TERMINAL MESIN DEBIT/KREDIT BERMASALAH\r\n\r\nMOHON JASA BAIK PIHAK TUAN @ ICT HELPDESK UNTUK MENYELESAIKAN SEGERA MASALAH TERMINAL MESIN DEBIT/KREDIT DI KAUNTER WANGSA MAJU KERANA DIDAPATI IANYA BERMASALAH DAN TIDAK MEMPUNYAI "LINE".\r\n \r\nHAL INI SANGAT MERUMITKAN KEADAAN BILAMANA ADA BAYARAN MELALUI TRANSAKSI INI TIDAK DAPAT DIJALANKAN. SEGALA JASA BAIK PIHAK TUAN MAHUPUN ICT HELPDESK, DIUCAPKAN RIBUAN TERIMA KASIH.\r\n \r\nNIK ARMIZA EZRA SYAH BIN ROSELAN', '22/3/2016 MERANG 1) CHECK CONECTION CABLE\r\n2) TERSILAP SAMBLUNG CABLE\r\n3) TERDAPAT 2 CABLE DISAMBUNG ADA PORT TERMINAL\r\n4) BETULKAN SAMBUNGAN\r\n5) TEST CONNECTION\r\n6) DONE @ 4:03PM\r\n', 107, '04:05:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15586, '017', '2016-03-23', '10:36:29', '205', '2016-03-23', '205       ', '2016-03-23', 3, 10, 219, 2445, 'TIDAK BOLEH CONNECT DENGAN EBANKER - ALRAJHI BANK', '23/3/2016 NARGIS - 1) TIADA APA-APA YANG KELUAR SELEPAS MEMASUKKAN ID & PASSWORD\r\n2) MEMERIKSA COMPATIBILITY VIEW SETTING - TIADA ALAMAT AL-RAHJI DIMASUKKAN\r\n3) MEMASUKKAN ALRAHJIBANK.COM.MY DI DALAM COMPATIBILITY VIEW\r\n4) TEST & OK', 106, '10:40:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(15587, '047', '2016-03-23', '12:16:20', '205', '2016-03-23', '205       ', '2016-03-23', 3, 9, 233, 2286, 'RESET PASSWORD EMAIL - TERLUPA', '23/3/2016 NARGIS - 1) PASSWORD DIRESET KERANA USER TIDAK INGAT PASSWORD LAMA\r\n2) RESET PASSWORD USER \r\n3) MEMBERITAHU USER TENTANG PASSWORD SEMENTARA & MEMINTANYA MENUKAR KE PASSWORD YANG BARU\r\n4) TEST & OK', 128, '12:20:00', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
